import React, { useState, useEffect } from "react";
import store from "../../Store/Mobx";

function TodoList() {
  const [todo, setTodo] = useState([]);

  useEffect(() => {
    async function load() {
      let data = await storere.loadTodos();
      setTodo(data);
    }
    load();
  }, []);

  return (
    <>

      <div>
        {todo.map((item, index) => {
          return <li key={index}>{item.todo}</li>;
        })}
      </div>
    </>
  );
}

export default TodoList;
